// DEPENDENCIES
const React = require('react');
const Def = require('./default');

function home(){
    return (
        <Def>
            <main>
                <h1>Pokemon-Style Game</h1>
                <p>Game needs a new title before we get a cease and desist from Nintendo</p>
            </main>
        </Def>
    )
}

// EXPORTS
module.exports = home

