// Error page
//import React and Def from default.jsx
const React = require('react');
const Def = require('./layouts/default');

//create error404 stub function
function error404 () {
    return(
        // Using Def component as a wrapper
        <Def>
            <main>
                <h1>404: PAGE NOT FOUND</h1>
                <p>Sorry, the page you seek does not exist.</p>
                <p>Return to home page?</p>
                <a href='/'>
                    <button className='btn-primary'>Take Me Home</button>
                </a>

            </main>
        </Def>
    )

}

//export error404 function
module.exports = error404;

