// DEPENDENCIES
const React = require('react');
const Def = require('./default');

function instructions(){
    return (
        <Def>
            <main>
                <h1>INSTRUCTIONS</h1>
            </main>
        </Def>
    )
}

// EXPORTS
module.exports = instructions
